fields.inclusion_criteria:
Pacientes con edad entre 18 y 75 años con evidência sorológica de infección por Chagas (cualquier combinación de 2 testes positivos) y que tenga una o más de las siguintes condiciones:
Eletrocardiograma anormal con por lo menos dos componentes (bloqueo completo de ramo derecho, bloqueo divisional ântero-superior isquierdo, alteración de la repolarización inferolateral y sobrecarga ventricular isquierda, bradicardia sinusal y fibrilación atrial);
ECG anormal (Mobitz tipo II, bloqueo AV avanzado o de tercer grado)

Pacientes com idade entre 18 e 75 anos com evidência sorológica de infecção por Chagas (qualquer combinação de 2 testes positivos) e que tenha uma ou mais das seguintes condições:
Eletrocardiograma anormal com no mínimo dois componentes (bloqueio completo do ramo direito, bloqueio divisional ântero-superior esquerdo, alteração da repolarização inferolateral e sobrecarga ventricular esquerda, bradicardia sinusal e fibrilação atrial);
ECG anormal (Mobitz tipo II, bloqueio AV avançado ou de terceiro grau)

Consenting patients (between 18 and 75 years of age) with serological evidence of Chagas infection (any combination of 2 positive tests) and that have one or more of the following:
Abnormal electrocardiogram with at least two components (complete RBBB or LBBB; left anterior or posterior fascicular block; ventricular premature beat; first degree atrioventricular [AV] block; Mobitz type I AV block; sinus bradycardia; primary ST-T changes; abnormal Q waves; low voltage QRS; or atrial fibrillation);
Abnormal ECG (Mobitz type II, advanced or third degree AV block)
